import { React, useEffect, useState } from 'react';
import './Main.css';
import axios from 'axios';

const Main = () => {

    useEffect(() => {
        axios.get('https://dog.ceo/api/breeds/image/random')
        .then(res => {
            console.log(res)
        })
        .catch(err => {
            console.log(err)
        })
    }, [])

    return (
        <div>
            Main
        </div>
    );
}

export default Main;
